import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">Twit 0</div>,
        <div key="following">Following 0</div>,
        <div key="follower">Follower 0</div>,
      ]}
    >
      <Card.Meta
        avatar={<Avatar>YK</Avatar>}
        title="ykwimk"
      />
    </Card>
  )
}

export default UserProfile;
